using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.ComponentModel.DataAnnotations;
using System.Runtime.CompilerServices;
using Tramy.Common.Common;

namespace Tramy.Common.Locations
{
    /// <summary>
    /// Part of location with own map
    /// </summary>
    public class LocationPart:BaseMongoItem, INotifyPropertyChanged
    {
        /// <summary>
        /// Name of location part
        /// </summary>
        private string _name { get; set; }

        /// <summary>
        /// X meters of location part
        /// </summary>
        private decimal _sizeX { get; set; } = 140;

        /// <summary>
        /// Y meters of location part
        /// </summary>
        private decimal _sizeY { get; set; } = 140;

        /// <summary>
        /// Is main part
        /// </summary>
        private bool _isMain { get; set; }

        /// <summary>
        /// Scale koefficient X
        /// </summary>
        public decimal Kx { get; set; }

        /// <summary>
        /// Scale koefficient 
        /// </summary>
        public decimal Ky { get; set; }

        /// <summary>
        /// Is main part
        /// </summary>
        private bool _hasEntry { get; set; }

        /// <summary>
        /// Name of location part
        /// </summary>
        [Required]
        public string Name
        {
            get
            {
                return _name;
            }

            set
            {
                if (value != _name)
                {
                    this._name = value;
                    NotifyPropertyChanged();
                }
            }
        }

        /// <summary>
        /// Location has entry from street
        /// </summary>
        public bool HasEntry
        {
            get
            {
                return _hasEntry;
            }

            set
            {
                if (value != _hasEntry)
                {
                    this._hasEntry = value;
                    NotifyPropertyChanged();
                }
            }
        }

        /// <summary>
        /// Main part of location
        /// </summary>
        public bool IsMain
        {
            get
            {
                return _isMain;
            }

            set
            {
                if (value != _isMain)
                {
                    this._isMain = value;
                    NotifyPropertyChanged();
                }
            }
        }

        /// <summary>
        /// Image of location part in Base64 string
        /// </summary>
        [Required]
        public string Map { get; set; } = "data:image/jpg;base64,";

        /// <summary>
        /// Max coordinate of X dimension. 1 unit = 1 meter
        /// </summary>
        [Required]
        public decimal SizeX
        {
            get
            {
                return _sizeX;
            }

            set
            {
                if (value != _sizeX)
                {
                    this._sizeX = value;
                    NotifyPropertyChanged();
                }
            }
        }

        /// <summary>
        /// Max coordinate of Y dimension. 1 unit = 1 meter
        /// </summary>
        [Required]
        public decimal SizeY
        {
            get
            {
                return _sizeY;
            }

            set
            {
                if (value != _sizeY)
                {
                    this._sizeY = value;
                    NotifyPropertyChanged();
                }
            }
        }

        /// <summary>
        /// Devices in location part. IEnumerable of links to Device
        /// </summary>
        public IEnumerable<Guid> Devices { get; set; } = new List<Guid>();

        /// <summary>
        /// Measured points in location part. IEnumerable of links to Measured Point
        /// </summary>
        public IEnumerable<Guid> MeasuredPoints { get; set; } = new List<Guid>();

        /// <summary>
        /// Polygons in location part. IEnumerable of links to Polygon
        /// </summary>
        public IEnumerable<Guid> Polygons { get; set; } = new List<Guid>();

        /// <summary>
        /// Handler gor property changed
        /// </summary>
        public event PropertyChangedEventHandler PropertyChanged;

        // This method is called by the Set accessor of each property.
        // The CallerMemberName attribute that is applied to the optional propertyName
        // parameter causes the property name of the caller to be substituted as an argument.
        private void NotifyPropertyChanged([CallerMemberName] string propertyName = "")
        {
            if (PropertyChanged != null)
            {
                PropertyChanged(this, new PropertyChangedEventArgs(propertyName));
            }
        }
    }
}
